#include "ModelMatrix.hpp"
#include "Matrix.hpp"

  /*!
   * Function that gets the rate matrix for the specified model 
   * @param model The wanted model 
   * @return The rate matrix for that model
   */
Matrix get_model_matrix(model_type model){
  Matrix m;
  switch (model){
    case arve:
      m = get_arvestad();
      break;
    case jtt:
      m = get_jtt();
      break;
    case day:
      m = get_day();
      break;
    case mvr:
      m = get_mvr();
      break;
    case wag:
      m = get_wag();
      break;
    default:
      break;
  }
  return m;
}

  /*!
   * Gets the equilibrium distribution for a specified model
   * @param model The wanted model 
   * @return The equilibrium distribution
   */
DblVec get_model_vec(model_type model){
  DblVec vec;
  switch (model){
    case arve:
      vec = get_arve_eq();
      break;
    case jtt:
      vec = get_jtt_eq();
      break;
    case day:
      vec = get_day_eq();
      break;
    case mvr:
      vec = get_mvr_eq();
      break;
    case wag:
      vec = get_wag_eq();
      break;
    default:
      break;
  }
  return vec;
}

